    public static byte[] concatenateByteArrays(List<String> byteStringList) {
      List<Byte> byteList = new ArrayList<>();

      for (String byteString : byteStringList) {
        String[] byteValues = byteString
                .replace("[", "")
                .replace("]", "")
                .split(", ");

        for (String byteValue : byteValues) {
          byteList.add(Byte.parseByte(byteValue));
        }
      }

      byte[] concatenatedBytes = new byte[byteList.size()];
      for (int i = 0; i < byteList.size(); i++) {
        concatenatedBytes[i] = byteList.get(i);
      }

      return concatenatedBytes;
    }
